import React from 'react';
import { Row, Col, Icon, Tabs, Button, Modal, Layout, Badge, Table } from 'antd';
import 'antd/dist/antd.css';
import bg1 from '../../img/background1.png';
import mark from '../../img/校徽实体.png'

const { Header, Footer, Sider, Content } = Layout;
class Admin extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [],
        }
        this.logout=this.logout.bind(this);
    }
    logout() {
        this.props.setState({
            isWelcome: true,
            isLogin: false,
            isStudent: false,
            isAllDone: false,
            isAdmin: false,
            isTeacher: false,
            host: "",
            userInfo:
            {
                name: '',
                username: "",
                token: '',
                access: -1,
                score: -1
            },
            answer: {
                choice: {},
                true_false: {}
            },
        })
    }
    componentWillMount() {
    }
    render() {
        return (
            <React.Fragment>
                <Layout>
                    <Header>
                        <Row>
                            <Col span={12}>
                                <h1 style={{ color: 'white', fontSize: "25px" }}><img src={mark} height="45px" width="45px" />&nbsp;校史校情知识竞赛管理系统</h1>
                            </Col>
                            <Col span={4} offset={4}>
                            <Button ghost type="danger" onClick={this.logout}><Icon type="logout" />退出</Button>
                            </Col>
                        </Row>
                    </Header>
                    <Content>

                    </Content>
                </Layout>
            </React.Fragment>
        )
    }
}

export default Admin
